import React from "react";
import "./navigation.css";
import { Link } from "react-router-dom";

export default function Navigation() {
  return (
    <div className="nav">
      <ul>
        <li>
          <a href="/">Home</a>
        </li>
        <li>
          <a href="/presentation">Presentations</a>
        </li>
        <li>
          <a href="/addpresentation">Add Presentations</a>
        </li>
      </ul>
    </div>
  );
}
